AMOUNT_MAP = {"biomes": BIOMES_PER_CHUNK_SEGMENT, "blocks": BLOCKS_PER_CHUNK_SEGMENT}

def unpack_pallet(buf: Buffer, seg_type):
    bpe, data = buf.unpack_u8(), [buf.unpack_u64() for _ in range(buf.unpack_varint())]
    block_id_map = None
    if bpe == 0: # single value
        return [buf.unpack_varint()] * AMOUNT_MAP[seg_type]
    elif (seg_type == "biomes" and 1 <= bpe >= 3) or (seg_type == "blocks" and 4 <= bpe >= 8): # indirect
        block_id_map = [buf.unpack_varint() for _ in range(buf.unpack_varint())]
    processed_data = []
    mask = (2**bpe)-1
    for val in data:
        for i in range(64 // bpe):
            processed_data.append((val >> (i * bpe)) & mask)
    if block_id_map:
        processed_data = [block_id_map[val] for val in processed_data]
    return processed_data

